def protein_parser(string):
	protein_list = list()
	pointer = 0
	while pointer < len(string):
		protein_list.append(string[pointer:pointer+3])
		pointer += 3
	return protein_list

	
def prot(string):
	p_list = protein_parser(string)
	proteins = list()
	for i in p_list:
		proteins.append(protein_switch(i))
	return ''.join(proteins)


